import React from "react";
import "./index.scss";

const TaskPerformance = ({ texts }) => {
    return (
        <div className="task-performance-noAuth">
            <h2>Desempenho de tarefas</h2>
            <p className="desc-profiler">{texts.desempenho_tarefas.texto}</p>
        </div>
    );
};

export default TaskPerformance;
